function setCookie(a,d,c){var b=new Date;b.setTime(b.getTime()+864E5*c);c="expires="+b.toGMTString();document.cookie=a+"="+d+";"+c+";path=/"}function getCookie(a){a+="=";for(var d=decodeURIComponent(document.cookie).split(";"),c=0;c<d.length;c++){for(var b=d[c];" "==b.charAt(0);)b=b.substring(1);if(0==b.indexOf(a))return b.substring(a.length,b.length)}return""}function hasCookie(a){a=getCookie(a);return""!=a&&null!=a};